import Link from 'next/link';
import fetch from 'isomorphic-unfetch';

const Robots = () => {
    return (
        <div>
            <h1>Robots</h1>
            <Link href='/'>
                <a>Return Home</a>
            </Link>
            <div>Robots Data</div>
        </div>
    );
}

export default Robots;
